window.bookSummaryJSON = "<p>A new update arrives to the ultra-popular online game, <i>Realm of Arkon</i>. With Patch 17, the level of immersion experienced by players in their gaming capsules has made virtual reality indistinguishable from the real world. But every gamer's dream becomes a nightmare for Roman Kozhevnikov after he gets confined to Arkon against his will. And not just to Arkon, but to its deadliest zone - Demon Grounds. Playing - or rather living - as his character Krian, it's not just about survival for Roman. He longs to exact revenge for his banishment to the virtual world where the sensation of pain has reached 100 percent... </p>"; 
